class Index extends React.Component {
    render() {
        return(
        <div class="hero-image">
            <div class="hero-text">
                <h1>I am John Doe</h1>
                <p>And I'm a Photographer</p>
                <button>Hire me</button>
            </div>
        </div>
        )
    }
}
export default Index
